import '../css/Header.css';
import { Link } from 'react-router-dom';

function Header(){
    return (
        <Router>
        <Navbar bg="light" expand="lg" className='shadow-lg mb-5 mt-5 justify-content-center'>
        <Navbar.Brand href="/">Home</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
            <NavLink className='text-decoration-none text-light' href="/">Home</NavLink>
            <NavLink className='text-decoration-none text-light' href="/about">About</NavLink>
            <NavLink className='text-decoration-none text-light' href="/login">Login</NavLink>
            <NavLink className='text-decoration-none text-light' href="/register">Register</NavLink>
        </Nav>
        </Navbar.Collapse>
    </Navbar>
    </Router> 
    ) 
}
export default Header;
